import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(1);
  let arys:[]=[]
  const logs = ()=>{
    setName(name+1);
    const arg3 = [...Array(name)].map((_,i) => i+1)
    Array.prototype.push.apply(arys, arg3)
    console.log(arys)
  }

  return (
    <div>
      <h2>増えるボタン</h2>
      <div className="divbtn" onClick={logs}>{name}</div>
      )
    }
    </div>
  );
}

export default AddButton;
